import Navigation from '../components/Navigation'
import Head from 'next/head'

const BaseLayout = (props) => (
    <div>
      <Head>
        <title>Learn Next.js - Basic</title>
      </Head>
      <Navigation/>
        {props.children}
      <p>Footer - 2020</p>
    </div>
)

export default BaseLayout;
